import React from "react";
import "./Navbar.css";
import logo from "../images/logoB.png";
import name from "../images/nameB.png";

export default function Navbar() {
  return (
    <div className="bar">
      <div className="brand">
        <img src={logo} className="logo" />
        <img src={name} className="name" />
      </div>
      <div className="buttons"></div>
    </div>
  );
}
